column11:
At Lincoln Cooperative Preschool we strive to support the healthy development and growth of children.
We promote:

    A curiosity and love of learning;
    Respect for self and others;
    Playfulness, independence and responsibility;
    A sense of belonging and community.

The Lincoln Cooperative Preschool is a delightful place for children ages 3-5 to begin their school years. As a member of a cooperative preschool you and your family are partnering in your child’s experience. We provide a loving atmosphere where children are valued, safe, nurtured and respected.
